(SELECT count(v1.up_vote) FROM votes v1 where v1.post_based_id= p.id and v1.down_vote>0) as down_vote_count,p.cdate,
(SELECT COUNT(id) FROM comments WHERE post_id = p.id) AS comment_count,p.post_type_id,
IFNULL((SELECT vs.up_vote FROM votes vs where vs.post_based_id = p.id and vs.up_vote = \'undefined\' order by vs.id limit 1),0) as up_vote_user_id,
IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'undefined\' order by vs1.id limit 1),0) as down_vote_user_id 
FROM 
	posts p,users u 
where
    p.user_id = u.id 
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'undefined\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 0, 9 '
