IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'47\' order by vs1.id limit 1),0) as down_vote_user_id 
FROM 
	posts p,users u 
where
    p.user_id = u.id 
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'47\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 20, 29 '
